import React, { Component } from 'react'
import { allPosts } from './UserFunctions';

class Landing extends Component {
  constructor() {
    super();
    this.state = {
      post: []
    }
  }
  onLoad() {
    this.state.post = allPosts();
  }
  render() {
    return (
      <div className="container">
        <div className="jumbotron mt-5">
          <div className="col-sm-8 mx-auto">
            <h1 className="text-center">askIT</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-8 mx-auto">
              {
                <p>{this.state.post}</p>
              }
          </div>
        </div>
      </div>
    )
  }
}

export default Landing;
